import React from "react";

const listItem = () => {
  return(
    <div className="listItem" >
      <img 
        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQxPlfTb5vGLObzatr2lY0S2fdmHVXyrK6JREs9Akz_z7zkTfGquGv-FVrANt8_ZtV3qZc&usqp=CAU" 
        alt="Game of Thrones logo"
      />
    </div>
  )
}

export default listItem;
